import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App'
import Experts from './pages/experts';
import reportWebVitals from './reportWebVitals';

import {
  BrowserRouter as Router,
  Routes,
} from 'react-router-dom';

// Define your routes
const routes = [
  {
    path: '/',
    component: App,
  },
  {
    path: '/experts', // Corrected the path spelling here
    component: Experts,
  }
];

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Routes>
        {routes.map((route, index) => (
          <Route
            key={index}
            exact
            path={route.path}
            component={route.component}
          />
        ))}
      </Routes>
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
